import { useState } from "react/cjs/react.production.min";
import { useEffect } from "react/cjs/react.production.min";
import Web3 from "web3"


export default function InfoComponent(props){
    const web3=new Web3();
    console.log(props.printer);
    return (
        <div className="Info">
            <p >{web3.utils.toUtf8( props.printer['name'])}</p>
            {props.printer['soluble']?(<p>Si</p>):(<p>No</p>)}
            {props.printer['foodSafety']?(<p>Si</p>):(<p>No</p>)}
            <p >{ props.printer['volume']}</p>
            <p >{ props.printer['mountedNozzles']}</p>
            <p >{ props.printer['maxPrintTemperature']}</p>
            <p >{ props.printer['maxBedTemperature']}</p>

        </div>
    )
}
